variable {R : Type} [CommRing R] {M : Matrix (Fin 2) (Fin 2) R} 

theorem matrix_entries_zero (hM : M = 0) : M 0 1 = 0 ∧ M 1 0 = 0 :=
  by simp [hM]

variable {R : Type _} [CommRing R] {M : Matrix (Fin 2) (Fin 2) R}

theorem matrix_entries_zero (M : Matrix (Fin 2) (Fin 2) R) : M 0 1 = 0 ∧ M 1 0 = 0 :=
⟨rfl, rfl⟩
